from flieToLst import fileToList1
import copy
from flieToLstDegree import fileToList
from RSBF import finalOribit, TruthTableSelect, AllTruthTableSelect, initRSBF

def shortTableToLongTable(varsNum, RSTT):
    OribitList = finalOribit(varsNum)
    dicIndexList = initRSBF(varsNum, RSTT, OribitList)
    truthTable = TruthTableSelect(varsNum, dicIndexList)
    return truthTable

def bitBiger(lst1, lst2):
    j = 0
    for i in range(len(lst1)):
        if lst1[i] < lst2[j]:
            return False
        j += 1
    return True

def cAlpha(lst1, F2N, longTruthtable):
    ret = 0
    for i in range(len(F2N)):
        if bitBiger(lst1, F2N[i]) == True:
            ret = (ret +  longTruthtable[i]) % 2
    return ret

def getDegree(longTable, allInputTable):
    retLst = []
    for i in range(len(allInputTable)):
        retLst.append(cAlpha(allInputTable[i], allInputTable, longTable))

    maxdeg = 0
    for i in range(len(retLst)):
        if retLst[i] == 1:
           deg = allInputTable[i].count(1)
           if deg > maxdeg:
                maxdeg = deg
    return maxdeg




