def degDiv(varsNum, nonlinearity):
    for i in range(1, 33):
        RSTTLst = fileToList1(str(nonlinearity) + "_" + str(i) + ".txt")
        '''
            将短表转化为长表
        '''
        LongTableLst = []
        for ele in RSTTLst:
            LongTableLst.append(shortTableToLongTable(varsNum, ele[0]))

        '''
    
        '''
        allTruTable = AllTruthTableSelect(varsNum)
        for i in range(len(LongTableLst)):
            degree = getDegree(LongTableLst[i], allTruTable)
            with open("./res/" + str(nonlinearity) + "_" + str(degree) + ".txt", mode="a+", encoding="utf-8") as f:
                f.write(str(RSTTLst[i]) + "    " + str(degree) + "\n")


